import React from 'react';

import './sidebar.css';

import logo from '../../assets/images/logo.png'

import sidebar_items from '../../assets/JsonData/sidebar_routes.json';


const Sidebar = () => {
    return (
        <div className='sidebar'>
            <div className="sidebar__logo">
                <img src={logo} alt="" />
            </div>
        </div>
    )
}

export default Sidebar
